        <div className="chat__container">
           
            <div className="usersAndConversation">
                <div className="__users pageSlider">
                    <ProductCard></ProductCard>
                    <ProductCard></ProductCard>
                    <ProductCard></ProductCard>
                    <ProductCard></ProductCard>
                    <ProductCard></ProductCard>
                    <ProductCard></ProductCard>
                    <ProductCard></ProductCard>
                    <ProductCard></ProductCard>
                    <ProductCard></ProductCard>
                </div>
                <div className="__conversation">
                    <ChatFrame/>
                </div>
            </div>
        </div>
    )
}

export default Chat;
